import React from 'react';
import Table from 'react-bootstrap/Table';

const Cafe = (props) => {
    return (

        <tr>
            <td scope="row">{props.id}</td>
            <td>{props.nombre}</td>
            <td>{props.tipo}</td>
            <td>{props.region}</td>
        </tr>

    );

}

export default Cafe;
